import logo from './logo.svg';


import NavBar from './components/NavBar';
import Posts from './components/Posts';


function App() {
  return (
    <div className="App">


      <header className="container">
        <NavBar />


      </header>



        <div className="container" style={{ "backgroundColor": "#e3f2fd" }}>


        <Posts />

      </div>


    </div>
  );
}

export default App;
